import Feature from "../components/features/Feature";
import Functions from "../components/function/function";
import Navbar from "../components/navbar/navbar";
import './App.css';
// import { Container, Box } from "@mui/material";
import React, { useState, useEffect } from "react";

function App() {

  const [isVisible, setIsVisible] = useState(true);

  const toTop = {
    "color": "black",
    position: "fixed",
    right: "40px",
    bottom: "25px",
    "background": "#7868E6",
    "border-radius": "50%",
    height: "35px",
    width: "35px",
    display: "inline-block"
  }

  return (
    <div className="App">
      <Navbar />
      <Feature />
      <Functions />
      {
        isVisible
        &&
        <a href="# " uk-totop="true" uk-scroll="true" style={toTop}> </a>
      }
    </div>
  );
}

export default App;
